import React,{ useState} from 'react'

const UserForm = () => {
  const [username,setUsername]=useState("ChickenLady")
  const handleChange =(e)=>{
   setUsername(e.target.value)
  }

  const handleSubmit=(e)=>{
    e.preventDefault();
    alert(`Created user,${username}`)
    setUsername("")
  }
  return (
    // onSubmit on form or onClick on button
    <form onSubmit={handleSubmit}>
      <label >Enter Username</label>
      <input id='username' placeholder='username'value={username} onChange={handleChange}/>
      <button >Add me to List!</button>
    </form>
  )
}

export default UserForm
